%pyspark

from pyspark.mllib.regression import LabeledPoint
from numpy import array


def parse_line(line):
    features = line[1:6]
    label = line[6]
    if label == "fraud":
        label = 1.0
    else:
        label = 0.0

    if features[4] == "Congestion":
        features[4] = 1.0
    else:
        features[4] = 0.0

    return LabeledPoint(label,array([float(x) for x in features]))

cdr_data_training_data = cdr_data.map(parse_line)
cdr_data_training_data.take(30)
